import React from "react";
import { MapContainer, TileLayer, WMSTileLayer } from "react-leaflet";
import "leaflet/dist/leaflet.css";

const WMSMap = ({ height, city }) => {
    let layers = "";
    switch (city) {
        case "gothenburg":
            layers = "gothenburg_layer_name_here";
            break;
        case "vienna":
            layers = "vienna_layer_name_here";
            break;
        case "rennes":
            layers = "log_immo:v_batiment_desc";
            break;
        default:
            layers = "log_immo:v_batiment_desc";
            break;
    }

    return (
        <MapContainer
            center={[48.117266, -1.6777926]} // Center coordinates can be adjusted
            zoom={13}
            style={{ height: height, width: "100%" }}
        >
            <TileLayer
                url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            <WMSTileLayer
                url="https://public.sig.rennesmetropole.fr/geoserver/ows"
                layers={layers}
                format="image/png"
                transparent={true}
            />
        </MapContainer>
    );
};

export default WMSMap;
